import {Link} from 'react-router-dom'

const Dummy_Events = [
  {id: Math.random(), tittle: 'Event 1'},
  {id: Math.random(), tittle: 'Event 2'}
]

export default function EventPage() {
  
  return (
    <>
      <h1>EventPage</h1>
      {Dummy_Events.map(e => (<li key={e.id}><Link to={e.id}>{e.tittle}</Link></li>))}
    </>
  )
}
